// Sidebar.jsx

import React from 'react';
import "./sidebar.css"
import { Link } from 'react-router-dom';

const Sidebar = ({ showSidebar, toggleSidebar, userRole }) => {
  return (
    <div className={`sidebar ${showSidebar ? 'open' : ''}`}>
      <button className="close-button" onClick={toggleSidebar}>
        <div className="line"></div>
        <div className="line"></div>
        <div className="line"></div>  
      </button>
      <div className="links-container">
      {userRole === 'user' && <Link to="/">Home</Link>}
      {userRole === 'user' &&<Link to="/user/history">History</Link>}
        {userRole === 'superadmin' &&<Link to="/dashboards-a">Dashboard</Link>}
        {userRole === 'superadmin' && <Link to="/manage-users">Manage Users</Link>}
        {userRole === 'superadmin' && <Link to='/create-admin'>Create Admin</Link>}
        {userRole === 'superadmin' && <Link to='/superadmin'>View Admin</Link>}
        {userRole === 'superadmin' && <Link to='/superadmin/complaint'>Complaint</Link>}
        {userRole === 'superadmin' && <Link to='/superadmin/complaint'>Complaint</Link>}
        {userRole === 'user' &&<Link to="/user/new">Grievance</Link>}
        {userRole === 'admin' &&<Link to='/complaint'>Complaint</Link>}
        <Link to="/login" className='btn btn-danger'>Logout</Link>
      </div>
    </div>
  );
};

export default Sidebar;
